// import { ReactComponent as compliance } from "../assets/icons/compliance.svg";
import { ReactComponent as customers } from "../assets/icons/customers.svg";
import { ReactComponent as developers } from "../assets/icons/developers.svg";
import { ReactComponent as general } from "../assets/icons/general.svg";
import { ReactComponent as settings } from "../assets/icons/setting.svg";

export const SidebarMenuItems = [
  {
    id: "1",
    menuItem: "General Overview",
    Image: general,
    path: "/dashboard",
    useStroke: false,
  },
  {
    id: "2",
    menuItem: "Admin",
    Image: developers,
    path: "/admin",
    useStroke: false,
  },
  {
    id: "3",
    menuItem: "Customers",
    Image: customers,
    path: "/customers",
    useStroke: true,
    subMenu: [
      // {
      //   id: "1",
      //   item: "Oystr smart customers",
      //   path: "/customers/oystr-smart-costumers",
      // },
      {
        id: "2",
        item: "Data Consumers",
        path: "/customers/data-consumers",
      },
      {
        id: "3",
        item: "Data Givers",
        path: "/customers/data-givers",
      },
    ],
  },
  // {
  //   id: "4",
  //   menuItem: "Roles",
  //   Image: compliance,
  //   path: "/roles",
  //   useStroke: true,
  // },
  {
    id: "5",
    menuItem: "Settings",
    Image: settings,
    path: "/settings",
    useStroke: true,
  },
];
